import React from 'react';
import { Col, Row, Button, Typography, Space, Layout, Card } from 'antd';
import Navbar from '../components/NavbarBoleteria';
import { Link } from 'react-router-dom';
import FooterComponent from '../components/footer';

const { Title, Text } = Typography;
const { Content } = Layout;

function Boleteria() {
  return (
    <Layout className="background">
      <Row>
        <Col span={24}>
          <Navbar />
        </Col>
      </Row>

      <Content style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', padding: '24px' }}>
        <Card 
          style={{ 
            width: '100%', 
            maxWidth: '500px', 
            textAlign: 'center', 
            backgroundColor: '#dac178', 
            boxShadow: '0px 20px 50px rgba(0, 0, 0, 0.6)' 
          }} 
          bodyStyle={{ padding: '20px' }} 
          bordered={false}
        >
          
          {/* Contenedor de la "Pantalla" */}
          <div style={{ marginBottom: '20px', textAlign: 'center' }}>
            <div style={{ width: '80%', height: '30px', backgroundColor: '#6c757d', borderRadius: '8px', margin: '0 auto', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
              <Title level={3} style={{ color: '#242424', fontSize: '16px', margin: 0 }}>Pantalla</Title>
            </div>
          </div>

          {/* Indicadores de estado */}
          <div style={{ textAlign: 'left', marginBottom: '20px', width: '100%' }}>
            <Space direction="vertical" style={{ display: 'flex', alignItems: 'flex-start' }}>
              <Space style={{ display: 'flex', alignItems: 'center' }}>
                <div style={{ width: '10px', height: '10px', backgroundColor: '#28a745', borderRadius: '50%' }}></div>
                <Text strong style={{ marginLeft: '8px' }}>Seleccionado</Text>
              </Space>
              <Space style={{ display: 'flex', alignItems: 'center' }}>
                <div style={{ width: '10px', height: '10px', backgroundColor: '#dc3545', borderRadius: '50%' }}></div>
                <Text strong style={{ marginLeft: '8px' }}>Ocupado</Text>
              </Space>
            </Space>
          </div>

          {/* Botones de asientos */}
          <div>
            {['A', 'B', 'C', 'D'].map(row => (
              <Row key={row} justify="center" gutter={[16, 16]} style={{ marginBottom: '8px' }}>
                {[1, 2, 3, 4, 5].map(seat => (
                  <Col key={`${row}${seat}`} xs={4} sm={3} md={2} lg={1}> 
                    <Button 
                      type="default" 
                      style={{ 
                        borderRadius: '4px', 
                        width: '100%', // Asegura que el botón ocupe todo el ancho del Col
                        maxWidth: '50px', // Limita el tamaño máximo en pantallas grandes
                        height: '50px',  // Ajuste en altura
                        marginBottom: '8px', 
                        backgroundColor: '#aaa8a8', // Color gris para los botones
                        borderColor: '#000', // Borde negro
                        color: '#000', // Texto negro
                        fontWeight: 'bold' // Texto en negrita
                      }} 
                    >
                      {`${row}${seat}`}
                    </Button>
                  </Col>
                ))}
              </Row>
            ))}
          </div>
        </Card>

        {/* Botones de navegación */}
        <Row justify="space-between" style={{ width: '100%', maxWidth: '600px', marginTop: '20px' }}>
          <Col xs={24} sm={12} style={{ marginBottom: '10px' }}>
            <Link to="/cartelera">
              <Button 
                type="default" 
                style={{ 
                  backgroundColor: '#242424', 
                  color: '#fff', 
                  borderColor: '#242424', 
                  fontWeight: 'bold' 
                }} 
              >
                Atrás
              </Button>
            </Link>
          </Col>
          <Col xs={24} sm={12}>
            <Link to="/recibo">
              <Button 
                type="default" 
                style={{ 
                  backgroundColor: '#242424', 
                  color: '#fff', 
                  borderColor: '#242424', 
                  fontWeight: 'bold' 
                }} 
              >
                Siguiente
              </Button>
            </Link>
          </Col>
        </Row>
      </Content>

      <FooterComponent />
    </Layout>
  );
}

export default Boleteria;
